// element - DOMHTMLElement that triggered this function being called
// event - event that triggered this function being called
function createLabel(hypeDocument, element, event) {
	var rec = hypeDocument.getElementById('rec')
	var recRect = rec.getBoundingClientRect();
	var canv = hypeDocument.getElementById('cnvs')
	var cRect = canv.getBoundingClientRect();

	if (event['hypeGesturePhase'] == hypeDocument.kHypeGesturePhaseStart) {
		// When a gesture begins, get the initial position of the label's top/left X and Y coordinates. 
		var x = event.pageX - cRect.left
		var y = event.pageY - cRect.top
		originX = x
		originY = y 

	} else if (event['hypeGesturePhase'] == hypeDocument.kHypeGesturePhaseMove) {
		// save the current values to compare against on the next move
		var x = event.pageX - cRect.left
		var y = event.pageY - cRect.top
		endX = x
		endY = y 

		// Anchor corner of label to origin x/y
		rec.style.left = (originX).toString()+'px' 
		rec.style.top = (originY).toString()+'px' 

		// Compute length
		var length = Math.sqrt((endX - originX) 
        * (endX - originX) 
        + (endY - originY) 
        * (endY - originY));
        console.log('new width: '+length)
        rec.style.width = length.toString()+'px'

        //Compute angle
        var angle = 180 / Math.PI * Math.acos((endY - originY) / length);

        if(endX > originX) {
        	angle = angle - 90
    		angle *= -1;
    	} else {
    		angle = angle + 90
    	}

    	console.log('new angle: '+angle)

        rec.style['-webkit-transform'] = 'rotate('+angle+'deg)'
        rec.style['-moz-transform'] = 'rotate('+angle+'deg)'
        rec.style['-o-transform'] = 'rotate('+angle+'deg)'
        rec.style['-ms-transform'] = 'rotate('+angle+'deg)'
        rec.style['transform'] = 'rotate('+angle+'deg)'




	} else if (event['hypeGesturePhase'] == hypeDocument.kHypeGesturePhaseEnd) {
		console.log('OriginX: '+originX+', OriginY: '+originY)
		console.log('done')
	}

	}

