function createSelfie(hypeDocument, element, event) {
	var rec = hypeDocument.getElementById('selfierec')
	var recRect = rec.getBoundingClientRect();
	var canv = hypeDocument.getElementById('face')
	var cRect = canv.getBoundingClientRect();

	if (event['hypeGesturePhase'] == hypeDocument.kHypeGesturePhaseStart) {
		// When a gesture begins, get the initial position of the label's top/left X and Y coordinates. 
		var x = event.pageX - cRect.left
		var y = event.pageY - cRect.top
		originX = x
		originY = y 
		rec.innerHTML = 'SELFIE'

	} else if (event['hypeGesturePhase'] == hypeDocument.kHypeGesturePhaseMove) {
		// save the current values to compare against on the next move
