		// Compute length
		var length = Math.sqrt((endX - originX) 
        * (endX - originX) 
        + (endY - originY) 
        * (endY - originY));
        console.log('new width: '+length)
        rec.style.width = length.toString()+'px'

        //Compute angle
        var angle = 180 / Math.PI * Math.acos((endY - originY) / length);

        if(endX > originX) {
        	angle = angle - 90
    		angle *= -1;
    	} else {
    		angle = angle + 90
    	}

    	console.log('new angle: '+angle)

        rec.style['-webkit-transform'] = 'rotate('+angle+'deg)'
